import React from 'react';
import spareLines from "../data/spareLines"
import * as style from "../css/spareLine"

export default function SpareLines() {

  const renderSpareList = () => {
    return spareLines.map((item, i) => (
      <div style={style.spareLineItem}>{item}</div>
    ))
  }

  return (
    <React.Fragment>
      <div></div>
      <input/>
      <div style={style.spareLineContainer}>{renderSpareList()}></div>
    </React.Fragment>
  )
}
